import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';

const events = [
  {
    id: 1,
  }
]

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      viewCompleted: false,

      counter: 0,
    }

  }
}

export default App;
